import { DARKBLUE } from '../../utils/constants'

export const styles = StyleSheet.create({
  accountNameText: {
    textAlign: 'center',
    color: 'white',
    fontSize: 36,
    marginTop: 24,
  },
  bubbleText: {
    textAlign: 'center',
    color: DARKBLUE,
    marginTop: 12,
  },
